INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (179,'023','비로 새로운 영광을 확보했다 할지라도 일신이 있어 자리를 지키고 있으니 어찌겠습니까. 허실한 일은 삼가고 행하지 않음이 옳겠습니다. 마음은 있어도 이루지 못하면 도리어 신수를 공거하게 만들상입니다. 맹사가 분리하게 되고 놀사를 줌든 하던 일을 충실하게 지키면 이롭습니다. 일을 너무 맹신하다보면 마침내 실패하게 될 것이니 밝는 다리도 두둘겨 보고 건너는 신중함이 필요합니다. 글의 유수는 옳은것을 버리고 새것을 찾아야 합니다. 그러나 불분명한 곳에 발을 들이게 되면 친한 사람에게 배신을 당하거나 기대했던 사항이 끊지기 쉽습니다. 알기치 않은 일이 눈앞에서 일어나 고통을 겪게 될 수도 있으니 조심하십시오. 또한 시비를 조심하지 않으면 색사가 생겨 구설수에 말리게 되니 주의하십시오.','신수가 불리하여 우환이 올까 가히 두렵습니다. 의수가 자유자재로 통하지 아니하니 재물을 구하려고 애를 써도 쉽게 얻지 못합니다. 정월의 유수는 속히 하려고 서둘러대지만 뜻대로 이루어지지 않을 것이니 기다려야 합니다.','눈이 온 두리를 덮었는데 그 위에 또 서리가 내린 것으로 몸이 고달프고 어려운 수밖에 없겠습니다. 만약 손의수가 아니면 반드시 사람이 따르겠습니다. 구설수를 조심하십시오. 잘못하면 물건을 잃고 억히려 남들로부터 원망을 들을 수 있겠습니다.','고목이 봄철을 만나 천리에 비가 비치는 것입니다. 북방이 해로우나 점진적인 관계만 조심한다면 뜻을 이룰 수 있습니다. 앞에서 축하우이 기다리고 있으니 도덕을 조심해야 합니다. 분수를 지킨다면 그동안 기다리던 좋은 소식을 얻겠습니다.','사람들과 함께 낮은 두곡에 올랐으니 날이 다 지나도록 즐겁고 유쾌하기만 합니다. 분수 밖의 것을 탐하지 않는다면 바라는 것을 과히 얻을 수 있겠습니다. 다른 사람의 말을 가볍게 받아들인다면 후회해도 헤를 면할 길이 없겠습니다.','신운이 길하지 못하니 설령 재물을 구하려고 노력을 해도 마음대로 얻기가 어렵습니다. 마음이 고요하지 못하고 산란한데 어찌 곧하는 일이 쉽게 이루어질 수 있겠습니까. 만약 손의수가 아니면 구설수로 화를 입게 될 것이니 자중해야 합니다.','유수가 거슬림이 많아서 순조롭지 못하니 실패하기 쉽습니다. 친구를 무작정 믿고 일을 함께 도모했다가는 구설수를 면치 못하겠습니다. 혹 실패수가 두려거든 모든 일을 조심하고 밝는 도낭에 발들을 촘촘히 지 않도록 신중을 기해야 합니다.','옳은것을 버리고 새로운 것을 찾아 시행할 유수입니다. 봄 흙이 드디어 비를 만나서 날로 더 성장해 나가는 것인데 무엇을 망설이겠습니까. 유수는 평탄한 길을 찾았고 신수는 태평하니 태평대로를 달리 듯 힘차게 행진해 볼 일 입니다.','동쪽이나 남쪽에서 반드시 재물이 생길 것으로 보입니다. 처음 일을 시작할 때의 기백으로 밀고 나간다면 이득을 얻게 됩니다. 봄에 재물이 왕성해지는데 어찌 태평하지 않겠습니까. 그러나 이승을 가볍이 하지 마십시오. 그 일로 인한 구설수를 면케 어렵겠습니다.','그동안 몰아치는 폭풍우가 처음으로 지니 달이 산천에 비쳐 밝기가 하염없습니다. 불과 물을 조심하고 사람 사귀는 일에만 신중을 기한다면 반드시 어두운 밤이 끝나고 밝은 날을 맞이하게 될 것입니다. 소신을 가다듬어 일을 진행하십시오. 보람이 나타날 것입니다.','사람의 인연을 중히 여긴다면 반드시 인연이 있는 사람을 얻어 크게 이롭게 됩니다. 이득이 서쪽에 있으며 일을 마무리 짓는데서 생기는 이득입니다. 화가 끌려 들어와서 복이 되는 것이니 길흉이 상반한다하더라도 기쁨이 더 크겠습니다.','이 달의 유수가 불길하니 일을 구하여 도모할지라도 쉽게 이루기는 어렵습니다. 산에 올라가서 물고기를 구하는 것이라 곧하는 일이 억히려 허망하기만 합니다. 색사를 하지 마십시오. 반드시 손해가 뒤따릅니다. 찬고 갈등만 못하겠습니다.','관청에 드나들지 마십시오. 손의수가 문을 기다리고 있습니다. 볕 있는 집도 가볍이 하지 마십시오. 진실이 몸에 친절할까 두렵습니다. 첫 달의 유수는 이것만 조심하면 기쁜 일이 들짐할 수입니다. 마침내 뜻을 이루고 기쁨을 함께 나누어 가지게 되겠습니다.','2025-03-02 03:02:01.072477+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (392,'023','即使您在雨中有新的荣耀，也有新的生活，那为什么要坐下来呢？避免做错事是正确的。如果您有一颗心，您将无法实现它。如果君主分开并忠于任务，那将是有益的。如果您太盲目工作了，您最终会失败，因此您需要小心地越过明亮的腿。本文的领导必须放弃权利并找到新的。但是，如果您进入一个不清楚的地方，那么很容易打破亲密的人的背叛或期望。请注意，您不知道的事情可能会站在您的眼前并遭受痛苦。另外，如果您对施肥不小心，则会有颜色并在古斯苏尔（Gusulsu）干燥。','Shinsu不利，所以恐怕Woohwan会来。由于该数字无法自由工作，因此即使您尝试节省财富，也不容易获得。新年的主要水很迅速，但不会按照遗嘱完成。','它覆盖了雪，很难看到上面的霜。如果没有，人们一定会跟随。小心Gusulsu。如果您做错了，您将能够失去商品并听取他人的怨恨。','老树遇到春天，下雨了。如果北部是小心或逐渐的，则可以实现它。恭喜您之前等待着，所以要小心道德。如果您保留喷泉，我将得到我一直在等待的好消息。','这一天是与人一起攀登之后的一个有趣而愉快的一天。如果您在喷泉之外不渴望任何东西，则可以得到想要的东西。如果您明确接受别人的话，您将无法避免。','Shinwoon不久了，因此，即使您尝试找到财富，也很难获得它。它不是安静而产卵的，怎么会很容易做到？如果您不是一只手，您会对Gusulsu生气。','失败很容易，因为由于许多领先的流并不那么流畅。我相信我的朋友，共同努力。如果您想失败，则应注意不要谨慎对待一切，并在明亮的Doang中紧紧地保持双脚。','这是放弃权利并找到新事物的领先方式。春季土壤终于遇到了雨水，每天都有更多的生长。 Yusu发现了一条平坦的道路，Shin -Soo将猛烈地前进，好像他在泰皮（Taepyeong -Daero）上奔跑一样。','似乎必须在东方或南部创造财富。如果您将其推到开始首次工作的那一刻，您将获得好处。我们怎么能在春季不和平？但是不要点燃这个。因此，很难面对古苏尔-Soo。','同时，由杜松子酒（杜松子酒，月亮）驱动的暴风雨在山溪中反映出来。如果您关心火和水照顾人，那么在黑暗之夜之后的一天，您肯定会有光明的一天。修剪您的信念并做事。这将是有益的。','如果您想到一个人的关系，则必须获得有关系的人。好处在西方，是完成工作的好处。被拖入愤怒是一种幸运，因此，即使吉尔在冲突中，快乐也会更大。','本月的主要水是不祥的，因此即使您能找到和工作也很难实现。我上山上拯救了鱼，所以我很快就能看到它。不要做颜色。它必须损坏。我不能只是冲突。','不要去政府办公室。索恩正在等待门。即使是阳光明媚的房子也不要点燃。恐怕真相对我的身体会很友善。如果您小心，第一个月的主要水可能会很高兴。最后，我们将实现意志并共享快乐。','2025-03-02 03:02:01.072477+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (463,'023','雨の中で新しい栄光があっても、新しい生活があります。なぜあなたは席を維持しているのですか？何か間違ったことをすることを控えることは正しいです。あなたが心を持っているなら、あなたはそれを達成することができません。君主が分離され、タスクに忠実である場合、それは有益です。あなたが盲目に仕事をしていない場合、あなたは最終的に失敗するので、明るい脚を交差させて交差させるように注意する必要があります。記事の主要な人は、右を見捨てなければならず、新しいものを見つけなければなりません。ただし、不明確な場所に足を踏み入れた場合、親密な人による裏切りや期待を簡単に破るのは簡単です。あなたが知らないことはあなたの目の前で立ち上がって苦しむかもしれないことに注意してください。また、受精に注意を払わない場合は、色がかかり、グスルルスで乾燥させます。','忍は不利なので、ウーワンが来るのではないかと心配しています。数は自由に機能しないため、富を救おうとしても簡単に取得できません。新年の主要な水は急いで急いでいますが、遺言に従って行われません。','それは雪を覆っており、その上に霜を見るのは困難でした。そうでない場合、人々は確かに従うでしょう。 Gusulsuに注意してください。間違っている場合、商品を失い、他の人からのresりを聞くことができます。','古い木は春に会い、雨は雨が降っています。北部が慎重または漸進的な場合は、達成できます。おめでとうございますので、道徳に注意してください。あなたが噴水を保持しているなら、私は私が待っていた良いニュースを得るでしょう。','それは人々と一緒に登られた後、楽しくて楽しい日です。噴水以外のものは何も切望していない場合は、必要なものを手に入れることができます。他の人の言葉を軽く受け入れると、それを避けることはできません。','シンウーンは長くないので、たとえ富を見つけようとしたとしても、それを手に入れることは困難です。それは静かで生まれていません、どうして簡単にできるのでしょうか？あなたが手でなければ、あなたはグスルスーに腹を立てるでしょう。','多くの主要なストリームのためにそれほど滑らかではないため、失敗するのは簡単です。私は私の友人を信じて、一緒に働いて一緒に働きます。失敗したい場合は、すべてに注意しないでください。','それは、権利を放棄し、新しいものを見つけるための主要な方法です。春の土壌はついに雨に出会い、毎日より多く育ちます。ユスは平らな道路を見つけ、シン・ソーはまるで彼がテピョン・ダイロで走っているかのように激しく行進するつもりです。','富は東または南に作成されなければならないようです。最初の作業を開始する瞬間にプッシュすると、利益が得られます。どうして春に平和ではないのでしょうか？しかし、これを照らしないでください。そのため、ガスル-soに直面することは困難です。','それまでの間、ジンによって駆動される嵐、月は山の小川に反映されています。あなたが火と水を気にし、人々の世話をするなら、あなたはきっと暗い夜の後の明るい一日を過ごすでしょう。あなたの信念をトリミングして、物事をしてください。やりがいがあります。','人の関係を考える場合、関係のある人を得る必要があります。利益は西側であり、仕事を終えることの利点です。怒りに引きずられるのは祝福です。したがって、たとえギルが対立していても、喜びは大きくなります。','今月の主要な水は不吉であるため、見つけて仕事をしても達成することは困難です。私は山を上って魚を救うので、すぐにそれを見ることができます。色をしないでください。破損する必要があります。私はただ対立することはできません。','官庁に行かないでください。ソンはドアを待っています。日当たりの良い家でさえ光を灯さないでください。私は真実が私の体に親切になるのではないかと心配しています。あなたが注意するならば、最初の月の主要な水は幸せになります。最後に、私たちは意志を達成し、一緒に喜びを共有します。','2025-03-02 03:02:01.072477+00','j');
